import React, { Component } from 'react';

class LiveStreamButton extends Component {
    render() {
        return (
            <div className="livestream-button">
            
                <a href = 'true'><img src={require('../images/livestream_league_03.png')} /></a>
                <a href = 'true'><img src={require('../images/livestream_league_05.jpg')} /></a>
                <a href = 'true'><img src={require('../images/livestream_league_09.jpg')} /></a>
                <a href = 'true'><img src={require('../images/livestream_league_10.jpg')} /></a>
          </div>
        );
    }
}

export default LiveStreamButton;
